import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";
import ItemCard from "../../components/ui/ItemCard";

export const Offer = ({ setSelected, user }) => {
  const [theme, setTheme] = useContext(ThemeContext);
  console.log(user);
  return (
    <div
      className={`col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full `}
    >
      <div className="flex w-full justify-end">
        {user.role != "P" && (
          <button
            id="btn_ViewOffer"
            onClick={() => {
              setSelected("ViewOffer");
            }}
            className="hover:bg-green-700   bg-green-500 text-white rounded-lg px-4 py-2 mt-4 "
          >
            <i class="fa-solid fa-pen mr-2"></i>
            Edit
          </button>
        )}
      </div>
      <ItemCard setSelected={setSelected} />
    </div>
  );
};
